        #region Private Methods

        private void CtlQueryFaelleAnInaktivenUsern_Load(object sender, System.EventArgs e)
        {
            edtUser.LoadQuery(DBUtil.OpenSQL(@"
            select Code = NULL, Text = NULL
            union
            select Code = usr.UserID, Text = usr.DisplayText + ' (' + CAST(count(*) as varchar) + ')'
            from vwuser usr
              inner join xorgunit_user otu on otu.userid = usr.userid
              inner join fafall        fal on fal.userid = usr.userid
            inner join faleistung lei on lei.fafallid = fal.fafallid
            where otu.orgunitid in(184,185) and fal.datumbis is null
            group by usr.UserID, usr.DisplayText
            --order by count(*) desc"));
        }

